INSERT INTO `gsm_article` VALUES (6,-1,'用户协议','','','','',0,1,1418351509,'',0,'',''),(36,2,'Condiciones generales de venta','<h1 style=\"box-sizing: border-box; margin: 0px 0px 14px; padding: 0px; border: 0px; font-size: 30px; font-family: Arial, sans-serif; font-weight: inherit; line-height: 1em; color: rgb(119, 119, 119); outline: 0px; vertical-align: top; background: rgb(252, 252, 252);\">Condiciones generales de venta</h1>\r\n<hr style=\"box-sizing: content-box; margin: 0px; padding: 0px; border-top-style: solid; border-right-width: 0px; border-bottom-width: 0px; border-left-width: 0px; border-color: rgb(234, 234, 234); height: 0px; color: rgb(119, 119, 119); font-family: Arial, sans-serif; font-size: 13px; line-height: 20px; background-color: rgb(252, 252, 252);\" />\r\n<div class=\"theme_box secciontexto\" style=\"box-sizing: border-box; margin: 20px 0px 0px; padding: 20px 19px; border: 1px solid rgb(234, 234, 234); outline: 0px; vertical-align: top; position: relative; border-radius: 3px; font-size: 13px; color: rgb(119, 119, 119); font-family: Arial, sans-serif; line-height: 20px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: padding-box; background-clip: padding-box; background-position: initial; background-repeat: initial;\">\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">Antes de comprar en una tienda online, debemos leernos las pol&iacute;ticas de devoluci&oacute;n, especialmente donde figuran las condiciones en las que un producto puede ser devuelto, plazos y garant&iacute;as, tambi&eacute;n tenemos que tener en cuenta si los gastos de env&iacute;o en caso de disconformidad correr&aacute;n a nuestro cargo o por el contrario ir&aacute;n a cuenta de la tienda.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">Con excepci&oacute;n de los t&eacute;cnicos cualificados y que pertenezcan a (ASAT) Asociaci&oacute;n de Servicios de Asistencia T&eacute;cnica, GsmLanTe es una tienda on line en la que el 90% de sus productos son recambios para reparaciones electr&oacute;nicas que se utilizab para reemplazar los originales en m&aacute;quinas o equipos que debido a su uso diario han sufrido deterioro o una aver&iacute;a. Estos repuestos carecen de garant&iacute;a, puesto que son recambios susceptibles de averiarse al ser instalados en su equipo averiado.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">Una vez recibido el pedido, dispones de 48 horas para ponerte en contacto con nosotros o tramitar la RMA en el caso de que no funcione el repuesto adquirido. Esta es la &uacute;nica garant&iacute;a de recambio a la que se tiene derecho. Ten en cuenta que cuando llegas a&nbsp;GsmLanTe&nbsp;con la intenci&oacute;n de comprar un recambio, ya tienes una aver&iacute;a en tu equipo. En ning&uacute;n caso la pieza o el repuesto que est&aacute;s a punto de adquirir, puede ocasionar una aver&iacute;a al dispositivo.<br style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: none;\" />\r\nPero por el contrario, un equipo averiado, s&iacute; puede estropear la pieza que nosotros vendemos Si dudas de que la pieza que est&aacute;s a punto de adquirir no es la soluci&oacute;n al problem, por favor, no la compres.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">Si decides comprar la pieza, has de saber que no se realizar&aacute;n abonos, devoluciones o cambios de piezas o componentes electr&oacute;nicos susceptibles de averiarse por descargas electrost&aacute;ticas, manipulaci&oacute;n indebida o tratarse de componentes fungibles tales como: Pantallas, Displays, LCDS, Digitalizadores, Circuitos flex, Bater&iacute;as, Circuitos integrados, Componentes SMD.</p>\r\n<h4 style=\"box-sizing: border-box; margin: 30px 0px 15px; padding: 0px; border: 0px; font-family: inherit; font-weight: inherit; line-height: 1em; color: inherit; font-size: 18px; outline: 0px; vertical-align: top; background: transparent;\">Indicaciones:</h4>\r\n<ol class=\"listanumerada\" style=\"box-sizing: border-box; margin: 0px; padding: 10px 0px 0px 40px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; list-style: none; counter-reset: numList 0; background: transparent;\">\r\n    <li style=\"box-sizing: border-box; margin: 5px 0px 10px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; position: relative; line-height: 1.3; background: transparent;\">Aseg&uacute;rate por la imagen que es el componente que necesitas.</li>\r\n    <li style=\"box-sizing: border-box; margin: 5px 0px 10px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; position: relative; line-height: 1.3; background: transparent;\">Los pedidos realizados con forma de env&iacute;o&nbsp;<b style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: top; background: transparent;\">&quot;Recoger en local&quot;</b>&nbsp;tardar&aacute;n 24 horas en elaborarse, por lo que, tendr&aacute;s que venir como m&aacute;s temprano al d&iacute;a siguiente a recogerlos, nunca en el mismo d&iacute;a. Una vez que recibas el email de confirmaci&oacute;n, dispondr&aacute;s de 3 d&iacute;as h&aacute;biles para recoger el pedido.&nbsp; Pasados esos d&iacute;as, el pedido se deshar&aacute; y no podr&aacute;s recogerlo, y los productos ser&aacute;n incorporados de nuevo a la cadena de venta.</li>\r\n    <li style=\"box-sizing: border-box; margin: 5px 0px 10px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; position: relative; line-height: 1.3; background: transparent;\">No se aceptar&aacute;n devoluciones por confusiones por parte del cliente. F&iacute;&iacute;jate bien por la foto que es el componente que necesitas. No se aceptar&aacute;n devoluciones si no es por fallo del producto, si finalmente no necesitas el producto o tu cliente no acepta tu presupuesto, guarda el producto para futuras reparaciones.</li>\r\n    <li style=\"box-sizing: border-box; margin: 5px 0px 10px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; position: relative; line-height: 1.3; background: transparent;\">Los repuestos de telefon&iacute;a m&oacute;vil, tales como pantallas, digitalizadores, flex y bater&iacute;as tienen un precio oscilante en el mercado ya que est&aacute;n fluctuando cont&iacute;nuamente, por lo que quedan excluidos del derecho de desistimiento.</li>\r\n    <li style=\"box-sizing: border-box; margin: 5px 0px 10px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; position: relative; line-height: 1.3; background: transparent;\">Antes de realizar su pedido comprueba que el componente solicitado figura el cuadro de stock en verde o amarillo como existencia.</li>\r\n    <li style=\"box-sizing: border-box; margin: 5px 0px 10px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; position: relative; line-height: 1.3; background: transparent;\">La aceptaci&oacute;n del pedido est&aacute; sujeto a la aceptaci&oacute;n de &eacute;ste por parte de GSMLANTE, S.L. y a la disponibilidad de stock.</li>\r\n    <li style=\"box-sizing: border-box; margin: 5px 0px 10px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; position: relative; line-height: 1.3; background: transparent;\"><span id=\"hh\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">No se realizar&aacute;n abonos, devoluciones o cambios de pantallas que tengan restos de pegamento, hayan sido pegadas, o retirados los protectores, tienes que comprobar el correcto funcionamiento sin pegar ni retirar las protecciones.</span></li>\r\n    <li style=\"box-sizing: border-box; margin: 5px 0px 10px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; position: relative; line-height: 1.3; background: transparent;\">Los productos tales como pantallas, LCDs, displays, digitalizadores, circuitos flex carecen de garant&iacute;a, solo disponen de dos d&iacute;as de prueba, a partir de entonces quedan exentos de garant&iacute;a o cambio, por ser estos componentes de cristal muy sensibles a averiarse por manipulaci&oacute;n o descargas electrost&aacute;ticas.&nbsp;</li>\r\n    <li style=\"box-sizing: border-box; margin: 5px 0px 10px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; position: relative; line-height: 1.3; background: transparent;\">No se aceptan devoluciones por confusiones al hacer el pedido por parte del cliente o porque no al final no lo necesite. Debes guardar la pieza para otra reparaci&oacute;n.&nbsp;</li>\r\n    <li style=\"box-sizing: border-box; margin: 5px 0px 10px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; position: relative; line-height: 1.3; background: transparent;\">Puedes solicitar tu pedido a trav&eacute;s de la p&aacute;gina web o de correo electr&oacute;nico.</li>\r\n    <li style=\"box-sizing: border-box; margin: 5px 0px 10px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; position: relative; line-height: 1.3; background: transparent;\">Con car&aacute;cter general, el comprador se compromete a inspeccionar de inmediato el art&iacute;culo adquirido y a comunicarlo antes de 24 horas.</li>\r\n    <li style=\"box-sizing: border-box; margin: 5px 0px 10px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; position: relative; line-height: 1.3; background: transparent;\">Una vez realizado el pedido, si deseas anularlo, debe ser, imprescindiblemente POR TEL&Eacute;FONO, no env&iacute;es un email, ya que los pedidos salen lo antes posible y corremos el riesgo de que cuando lo leamos sea demasiado tarde.</li>\r\n</ol>\r\n</div>','','','',0,1,1461825696,'',0,'http://',''),(37,2,'Garantías y devoluciones','<p>&nbsp;</p>\r\n<div class=\"theme_box secciontexto\" style=\"box-sizing: border-box; margin: 20px 0px 0px; padding: 20px 19px; border: 1px solid rgb(234, 234, 234); outline: 0px; vertical-align: top; position: relative; border-radius: 3px 3px 0px 0px; font-size: 13px; color: rgb(119, 119, 119); font-family: Arial, sans-serif; line-height: 20px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: padding-box; background-clip: padding-box; background-position: initial; background-repeat: initial;\">\r\n<h3 style=\"box-sizing: border-box; margin: 0px 0px 14px; padding: 0px; border: 0px; font-family: inherit; font-weight: inherit; line-height: 1em; color: inherit; font-size: 22px; outline: 0px; vertical-align: top; background: transparent;\">arant&iacute;as</h3>\r\n<b style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: top; background: transparent;\">La mercanc&iacute;a para la cual se solicita devoluci&oacute;n deber&aacute; cumplir los siguientes requisitos:</b>\r\n<ol style=\"box-sizing: border-box; margin: 0px; padding: 10px 0px 0px 40px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; list-style: none; counter-reset: numList 0; background: transparent;\">\r\n    <li style=\"box-sizing: border-box; margin: 5px 0px 10px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; position: relative; line-height: 1.3; background: transparent;\">No se admiten devoluciones de mercanc&iacute;a por un valor inferior a 15&euro;</li>\r\n    <li style=\"box-sizing: border-box; margin: 5px 0px 10px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; position: relative; line-height: 1.3; background: transparent;\">El tiempo transcurrido desde la recepci&oacute;n del paquete ser&aacute;, como norma general, inferior a 48 horas</li>\r\n    <li style=\"box-sizing: border-box; margin: 5px 0px 10px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; position: relative; line-height: 1.3; background: transparent;\">No se admitir&aacute; la devoluci&oacute;n de aquellos productos suministrados &quot;bajo pedido especial, solicitado por el cliente&quot;.</li>\r\n    <li style=\"box-sizing: border-box; margin: 5px 0px 10px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; position: relative; line-height: 1.3; background: transparent;\">Quedan excluidos de garant&iacute;a, los repuestos y accesorios considerados como fungibles o consumibles, expresamente: Auriculares o micr&oacute;fonos, bater&iacute;as, fundas, &oacute;pticas l&aacute;ser y elementos similares, as&iacute; como los gastos de transporte.</li>\r\n    <li style=\"box-sizing: border-box; margin: 5px 0px 10px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; position: relative; line-height: 1.3; background: transparent;\">Asimismo, quedan excluidas de la garant&iacute;a las aver&iacute;as o roturas producidas por accidente, maltrato, uso indebido, manipulaci&oacute;n por personal ajeno a nuestro Servicio t&eacute;cnico, limpieza con productos inadecuados, derramamiento de l&iacute;quidos, proximidad con fuentes de calor excesivo o condiciones similares.</li>\r\n    <li style=\"box-sizing: border-box; margin: 5px 0px 10px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; position: relative; line-height: 1.3; background: transparent;\">No se aceptan devoluciones de cables flex ni de bater&iacute;as. No se realizaran abonos, devoluciones o cambios de piezas o componentes electronicos susceptibles de averiarse por descargas electrostaticas, manipulacion indebida o tratarse de componentes fungibles tales como: Pantallas, Displays, LCDS, Digitalizadores, Circuitos flex, Baterias, Circuitos integrados, Componentes SMD. Los manos libres no se recogen, por motivos de higiene.</li>\r\n    <li style=\"box-sizing: border-box; margin: 5px 0px 10px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; position: relative; line-height: 1.3; background: transparent;\">Los repuestos de telefon&iacute;a m&oacute;vil, tales como PANTALLAS, DIGITALIZADORES, FLEX, BATERIAS son susceptibles a desgaste y tienen un precio oscilante en el mercado ya que est&aacute;n fluctuando cont&iacute;nuamente, por lo que quedan excluidos del&nbsp;<b style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: top; background: transparent;\"><a href=\"http://www.gsmlante.com\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; color: rgb(1, 134, 200); text-decoration: none; font-weight: inherit; outline: none !important; vertical-align: top; transition: color 0.7s ease, border-color 0.7s ease, background-color 0.7s ease; cursor: pointer; background: transparent;\">derecho de desistimiento</a></b>.</li>\r\n</ol>\r\n</div>\r\n<div class=\"theme_box secciontexto\" style=\"box-sizing: border-box; margin: 0px; padding: 20px 19px; border-style: solid; border-width: 0px 1px 1px; border-color: rgb(234, 234, 234); outline: 0px; vertical-align: top; position: relative; border-radius: 0px; font-size: 13px; color: rgb(119, 119, 119); font-family: Arial, sans-serif; line-height: 20px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: padding-box; background-clip: padding-box; background-position: initial; background-repeat: initial;\">\r\n<h3 style=\"box-sizing: border-box; margin: 0px 0px 14px; padding: 0px; border: 0px; font-family: inherit; font-weight: inherit; line-height: 1em; color: inherit; font-size: 22px; outline: 0px; vertical-align: top; background: transparent;\">Tiempo de almacenamiento de material</h3>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">Una vez tramitada la devoluci&oacute;n por nuestro SAT, cuya resoluci&oacute;n sea rechazada, tendr&aacute; que ser retirada por parte del cliente y dispondr&aacute; de&nbsp;<strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: top; background: transparent;\">2 meses de almacenamiento gratuito</strong>&nbsp;en nuestras instalaciones. Superado el plazo, el coste de almacenamiento y custodia por RMA ser&aacute; de&nbsp;<strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: top; background: transparent;\">1,50 &euro;/d&iacute;a</strong>&nbsp;transcurrido.&nbsp;</p>\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">El periodo&nbsp;<strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: top; background: transparent;\">m&aacute;ximo de almacenamiento</strong>&nbsp;desde la resoluci&oacute;n de su devoluci&oacute;n ser&aacute; de&nbsp;<strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: top; background: transparent;\">6 meses</strong>, finalizado este plazo sin recibir notificaci&oacute;n por parte del cliente, se proceder&aacute; al&nbsp;<strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: top; background: transparent;\">reciclado del material</strong>&nbsp;perdiendo el derecho as&iacute; de una posterior reclamaci&oacute;n.&nbsp;</p>\r\n</div>\r\n<div class=\"theme_box secciontexto\" style=\"box-sizing: border-box; margin: 0px; padding: 20px 19px; border-style: solid; border-width: 0px 1px 1px; border-color: rgb(234, 234, 234); outline: 0px; vertical-align: top; position: relative; border-radius: 0px; font-size: 13px; color: rgb(119, 119, 119); font-family: Arial, sans-serif; line-height: 20px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: padding-box; background-clip: padding-box; background-position: initial; background-repeat: initial;\">\r\n<h3 style=\"box-sizing: border-box; margin: 0px 0px 14px; padding: 0px; border: 0px; font-family: inherit; font-weight: inherit; line-height: 1em; color: inherit; font-size: 22px; outline: 0px; vertical-align: top; background: transparent;\">Requisitos de la mercanc&iacute;a devuelta</h3>\r\n<ol style=\"box-sizing: border-box; margin: 0px; padding: 10px 0px 0px 40px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; list-style: none; counter-reset: numList 0; background: transparent;\">\r\n    <li style=\"box-sizing: border-box; margin: 5px 0px 10px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; position: relative; line-height: 1.3; background: transparent;\">La devoluci&oacute;n ha sido autorizada por el Dpto. de garant&iacute;as.</li>\r\n    <li style=\"box-sizing: border-box; margin: 5px 0px 10px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; position: relative; line-height: 1.3; background: transparent;\">En el exterior del bulto deber&aacute;n constar, de forma visible, el N&uacute;mero de devoluci&oacute;n asignado.</li>\r\n    <li style=\"box-sizing: border-box; margin: 5px 0px 10px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; position: relative; line-height: 1.3; background: transparent;\">La mercanc&iacute;a enviada debe estar acompa&ntilde;ada de la Autorizaci&oacute;n de Devoluci&oacute;n.</li>\r\n    <li style=\"box-sizing: border-box; margin: 5px 0px 10px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; position: relative; line-height: 1.3; background: transparent;\">El embalaje original debe estar en perfectas condiciones de venta.</li>\r\n    <li style=\"box-sizing: border-box; margin: 5px 0px 10px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; position: relative; line-height: 1.3; background: transparent;\">El tiempo transcurrido desde la Autorizaci&oacute;n de Devoluci&oacute;n no supere los 7 d&iacute;as naturales.</li>\r\n    <li style=\"box-sizing: border-box; margin: 5px 0px 10px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; position: relative; line-height: 1.3; background: transparent;\">Gastos de transporte por cuenta del cliente (salvo indicaci&oacute;n contraria).</li>\r\n    <li style=\"box-sizing: border-box; margin: 5px 0px 10px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; position: relative; line-height: 1.3; background: transparent;\">En caso de que el pedido te llegue roto, tendr&aacute;s que ponerte en contacto con el transportista.</li>\r\n</ol>\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">&nbsp;</p>\r\n</div>\r\n<div class=\"theme_box secciontexto\" style=\"box-sizing: border-box; margin: 0px; padding: 20px 19px; border-style: solid; border-width: 0px 1px 1px; border-color: rgb(234, 234, 234); outline: 0px; vertical-align: top; position: relative; border-radius: 0px; font-size: 13px; color: rgb(119, 119, 119); font-family: Arial, sans-serif; line-height: 20px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: padding-box; background-clip: padding-box; background-position: initial; background-repeat: initial;\">\r\n<h3 style=\"box-sizing: border-box; margin: 0px 0px 14px; padding: 0px; border: 0px; font-family: inherit; font-weight: inherit; line-height: 1em; color: inherit; font-size: 22px; outline: 0px; vertical-align: top; background: transparent;\">Garant&iacute;a de repuesto</h3>\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">GSMLANTE S.L. es una tienda on line en la que el 90% de sus productos son recambios para reparaciones electr&oacute;nicas que se utiliza para reemplazar los originales en m&aacute;quinas o equipos que debido a su uso diario han sufrido deterioro o una aver&iacute;a. Estos repuestos carecen de garant&iacute;a, puesto que son recambios susceptibles de averiarse al ser instalados en un equipo averiado. Se dispone de 48 horas para ponerse en contacto con nosotros en el caso de que no funcione el repuesto adquirido. &Eacute;sta es la &uacute;nica garant&iacute;a de recambio a la se tiene derecho.</p>\r\n</div>\r\n<div class=\"theme_box secciontexto\" style=\"box-sizing: border-box; margin: 0px; padding: 20px 19px; border-style: solid; border-width: 0px 1px 1px; border-color: rgb(234, 234, 234); outline: 0px; vertical-align: top; position: relative; border-radius: 0px; font-size: 13px; color: rgb(119, 119, 119); font-family: Arial, sans-serif; line-height: 20px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: padding-box; background-clip: padding-box; background-position: initial; background-repeat: initial;\">\r\n<h3 style=\"box-sizing: border-box; margin: 0px 0px 14px; padding: 0px; border: 0px; font-family: inherit; font-weight: inherit; line-height: 1em; color: inherit; font-size: 22px; outline: 0px; vertical-align: top; background: transparent;\">Garant&iacute;a de fabricante</h3>\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">La compra de productos acabados tales como&nbsp;<strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: top; background: transparent;\">m&aacute;quinas, herramientas, tel&eacute;fonos m&oacute;viles, electr&oacute;nica de consumo</strong>, en nuestra tienda dispone de la garant&iacute;a oficial ofrecida por cada fabricante, de 2 a&ntilde;os. Una vez recibido el pedido, dispones de quince d&iacute;as para efectuar la devoluci&oacute;n.<br style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: none;\" />\r\n<br style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: none;\" />\r\nEsta garant&iacute;a no cubre ni abonar&aacute; los da&ntilde;os o defectos derivados de modificaciones, manipulaciones o ajustes que pudieran realizarse en el producto. Esta garant&iacute;a no ser&aacute; aplicable si el n&uacute;mero de serie del producto ha sido alterado, borrado, ha desaparecido o resulta ilegible.</p>\r\n</div>\r\n<div class=\"theme_box secciontexto\" style=\"box-sizing: border-box; margin: 0px; padding: 20px 19px; border-style: solid; border-width: 0px 1px 1px; border-color: rgb(234, 234, 234); outline: 0px; vertical-align: top; position: relative; border-radius: 0px 0px 3px 3px; font-size: 13px; color: rgb(119, 119, 119); font-family: Arial, sans-serif; line-height: 20px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: padding-box; background-clip: padding-box; background-position: initial; background-repeat: initial;\">\r\n<h3 style=\"box-sizing: border-box; margin: 0px 0px 14px; padding: 0px; border: 0px; font-family: inherit; font-weight: inherit; line-height: 1em; color: inherit; font-size: 22px; outline: 0px; vertical-align: top; background: transparent;\">Garant&iacute;a de reparaci&oacute;n</h3>\r\n<ol style=\"box-sizing: border-box; margin: 0px; padding: 10px 0px 0px 40px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; list-style: none; counter-reset: numList 0; background: transparent;\">\r\n    <li style=\"box-sizing: border-box; margin: 5px 0px 10px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; position: relative; line-height: 1.3; background: transparent;\">La mercanc&iacute;a defectuosa (no el repuesto) podr&aacute; ser devuelta con&nbsp;<b style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: top; background: transparent;\">nuestra aprobaci&oacute;n previa</b>. El plazo para reclamar es de 15 d&iacute;as a partir de la fecha del pedido. Por favor, recuerda que en caso de devoluciones de cualquier &iacute;ndole, el embalaje original (de tipo comercial) debe estar en&nbsp;<b style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: top; background: transparent;\">perfectas condiciones,</b>&nbsp;no admiti&eacute;ndose la devoluci&oacute;n y debiendo correr el cliente con los gastos de devoluci&oacute;n, de no cumplir con este condicionante. Antes de enviar cualquier producto defectuoso, debes ponerte en contacto con nosotros.</li>\r\n    <li style=\"box-sizing: border-box; margin: 5px 0px 10px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; position: relative; line-height: 1.3; background: transparent;\">Los productos fungilbles no tienen garant&iacute;a (Displays, Digitalizadores, bater&iacute;as, cargadores, flex, altavoces, etc.) y por lo tanto, no los recogemos.</li>\r\n    <li style=\"box-sizing: border-box; margin: 5px 0px 10px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; position: relative; line-height: 1.3; background: transparent;\">No se aceptar&aacute; ninguna devoluci&oacute;n por mala manipulaci&oacute;n por parte del cliente. .</li>\r\n    <li style=\"box-sizing: border-box; margin: 5px 0px 10px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; position: relative; line-height: 1.3; background: transparent;\">La manipulaci&oacute;n o variaci&oacute;n de cualquier producto soldado, cableado, componentes a&ntilde;adidos u otras causas anular&aacute; la garant&iacute;a. Antes de enviar cualquier producto defectuoso, debes realizar una RMA desde la web. Recuerda que es tu responsabilidad revisar el material en los 2 primeros d&iacute;as despu&eacute;s de recibirlo. Se contestar&aacute; con la mayor brevedad posible, con instrucciones detalladas para realizar el env&iacute;o. Para cualquier duda que pudiera surgir antes y despu&eacute;s de adquirir un producto en nuestra tienda, tenemos un equipo de profesionales dispuestos a ayudarte en lo que necesites, quienes podr&aacute;n asesorarte sobre cual es la mejor elecci&oacute;n o qu&eacute; se debe hacer en cualquier problema que aparezca. Por favor no nos expongas preguntas o dudas para usos que no est&acute;tn dentro de la legalidad vigente en Espa&ntilde;a, ya que no ser&aacute;n atendidas.</li>\r\n</ol>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\"><b style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: top; background: transparent;\">Real Decreto 58/1988, de 29 de enero RCL 1988\\244</b></p>\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">6.2. La garant&iacute;a que otorgue el servicio de asistencia t&eacute;cnica al respecto tendr&aacute; un per&iacute;odo de validez m&iacute;nimo de tres meses.<br style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: none;\" />\r\n6.3. El per&iacute;odo de garant&iacute;a de tres meses se entender&aacute; desde la fecha de la entrega del aparato y tendr&aacute; validez en tanto en cuanto el mismo no sea abierto y manipulado por el cliente o reparado por terceros.<br style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: none;\" />\r\n6.5. No se podr&aacute; reclamar nueva reparaci&oacute;n con cargo a la garant&iacute;a, cuando la aver&iacute;a, se produzca como Consecuencia de un uso inadecuado del aparato, ca&iacute;das, golpes o por causas de fuerza mayor. Esta circunstancia habr&aacute; de ser probada por el servicio de asistencia t&eacute;cnica que otorg&oacute; la garant&iacute;a.<br style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: none;\" />\r\n6.8. El Servicio de asistencia t&eacute;cnica no se responsabilizar&aacute; de la aver&iacute;a sobrevenida cuando el fallo se derive de la no aceptaci&oacute;n por parte del usuario de la reparaci&oacute;n o de posteriores de aver&iacute;as ocultas, siempre y cuando la referida falta de aceptaci&oacute;n se haga constar en la factura.</p>\r\n</div>','','','',0,1,1461825973,'',0,'http://',''),(38,2,'Derecho de desistimiento','<p>&nbsp;</p>\r\n<div class=\"theme_box secciontexto\" style=\"box-sizing: border-box; margin: 20px 0px 0px; padding: 20px 19px; border: 1px solid rgb(234, 234, 234); outline: 0px; vertical-align: top; position: relative; border-radius: 3px 3px 0px 0px; font-size: 13px; color: rgb(119, 119, 119); font-family: Arial, sans-serif; line-height: 20px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: padding-box; background-clip: padding-box; background-position: initial; background-repeat: initial;\">\r\n<h3 style=\"box-sizing: border-box; margin: 0px 0px 14px; padding: 0px; border: 0px; font-family: inherit; font-weight: inherit; line-height: 1em; color: inherit; font-size: 22px; outline: 0px; vertical-align: top; background: transparent;\">Excepciones al derecho de desistimiento</h3>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\"><b style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: top; background: transparent;\">Art&iacute;culo 103 de &uacute;ltima actualizaci&oacute;n del 29/03/2014:</b></p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\"><b style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: top; background: transparent;\">b) El suministro de bienes o la prestaci&oacute;n de servicios cuyo precio dependa de fluctuaciones del mercado financiero que el empresario no pueda controlar y que puedan producirse durante el periodo de desistimiento.</b><br style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: none;\" />\r\n<i style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">Todos nuestros repuestos, al no ser producto nacional , sino de importaci&oacute;n, est&aacute;n en constante fluctuaci&oacute;n con la divisa del d&oacute;lar, por lo que var&iacute;an diariamente.</i></p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\"><b style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: top; background: transparent;\">d) El suministro de bienes que puedan deteriorarse o caducar con rapidez.</b><br style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: none;\" />\r\n<i style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">Todos nuestros repuestos son susceptibles de averiarse por descargas electrost&aacute;ticas, por manipulaci&oacute;n indebida si no se toman las medidas de la normativa ESD, calor excesivo o condiciones similares.</i></p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\"><b style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: top; background: transparent;\">e) El suministro de bienes precintados que no sean aptos para ser devueltos por razones de protecci&oacute;n de la salud o de higiene y que hayan sido desprecintados tras la entrega.</b><br style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: none;\" />\r\n<i style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">No se admitir&aacute;n repuestos a los que se hayan desprecintado, tales como auriculares, micr&oacute;fonos...</i></p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\"><b style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: top; background: transparent;\">f) El suministro de bienes que despu&eacute;s de su entrega y teniendo en cuenta su naturaleza se hayan mezclado de forma indisociable con otros bienes.</b><br style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: none;\" />\r\n<i style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">Todos los repuestos a los que se le haya retirado el protector, pegamentos, cintas de uni&oacute;n de doble cara, circuitos flex doblados o soldados, siendo estos indisociables y no poder volver a su estado original.</i></p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">&nbsp;</p>\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">La mayor&iacute;a de nuestros repuestos no tienen derecho de desistimiento, por tratarse en su mayor&iacute;a de productos fungibles, delicados y susceptibles de averiarse por descargas electrost&aacute;ticas ESD. Si consideras que alg&uacute;n repuesto est&aacute; sujeto al derecho a desistimiento, descarga, cubre y env&iacute;anos&nbsp;<a href=\"http://www.impextrom.com/docs/formulario_desistimiento.pdf\" target=\"_blank\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; color: rgb(1, 134, 200); text-decoration: none; font-weight: inherit; outline: none !important; vertical-align: top; transition: color 0.7s ease, border-color 0.7s ease, background-color 0.7s ease; cursor: pointer; background: transparent;\"><b style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: top; background: transparent;\">este formulario</b></a>.</p>\r\n</div>\r\n<div class=\"theme_box secciontexto\" style=\"box-sizing: border-box; margin: 0px; padding: 20px 19px; border-style: solid; border-width: 0px 1px 1px; border-color: rgb(234, 234, 234); outline: 0px; vertical-align: top; position: relative; border-radius: 0px 0px 3px 3px; font-size: 13px; color: rgb(119, 119, 119); font-family: Arial, sans-serif; line-height: 20px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: padding-box; background-clip: padding-box; background-position: initial; background-repeat: initial;\">\r\n<h3 style=\"box-sizing: border-box; margin: 0px 0px 14px; padding: 0px; border: 0px; font-family: inherit; font-weight: inherit; line-height: 1em; color: inherit; font-size: 22px; outline: 0px; vertical-align: top; background: transparent;\">Condiciones de desistimiento</h3>\r\n<b style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: top; background: transparent;\">Art&iacute;culo 68. Contenido y r&eacute;gimen del derecho de desistimiento.</b>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">1. El derecho de desistimiento de un contrato es la facultad del consumidor y usuario de dejar sin efecto el contrato celebrado, notific&aacute;ndoselo as&iacute; a la otra parte contratante en el plazo establecido para el ejercicio de ese derecho, sin necesidad de justificar su decisi&oacute;n y sin penalizaci&oacute;n de ninguna clase.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">Ser&aacute;n nulas de pleno de derecho las cl&aacute;usulas que impongan al consumidor y usuario una penalizaci&oacute;n por el ejercicio de su derecho de desistimiento.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">2. El consumidor tendr&aacute; derecho a desistir del contrato en los supuestos previstos legal o reglamentariamente y cuando as&iacute; se le reconozca en la oferta, promoci&oacute;n publicidad o en el propio contrato.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">3. El derecho de desistimiento atribuido legalmente al consumidor y usuario se regir&aacute; en primer t&eacute;rmino por las disposiciones legales que lo establezcan en cada caso y en su defecto por lo dispuesto en este T&iacute;tulo.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\"><strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: top; background: transparent;\">Art&iacute;culo 70. Formalidades para el ejercicio del desistimiento.</strong></p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">El ejercicio del derecho de desistimiento no estar&aacute; sujeto a formalidad alguna, bastando que se acredite en cualquier forma admitida en derecho. En todo caso se considerar&aacute; v&aacute;lidamente ejercitado mediante el env&iacute;o del documento de desistimiento o mediante la devoluci&oacute;n de los productos recibidos.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\"><strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: top; background: transparent;\">Art&iacute;culo 71. Plazo para el ejercicio del derecho de desistimiento.</strong></p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">1. El consumidor y usuario dispondr&aacute; de un plazo m&iacute;nimo de catorce d&iacute;as naturales para ejercer el derecho de desistimiento.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">2. Siempre que el empresario haya cumplido con el deber de informaci&oacute;n y documentaci&oacute;n establecido en el art&iacute;culo 69.1, el plazo a que se refiere el apartado anterior se computar&aacute; desde la recepci&oacute;n del bien objeto del contrato o desde la celebraci&oacute;n de &eacute;ste si el objeto del contrato fuera la prestaci&oacute;n de servicios.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">3. Si el empresario no hubiera cumplido con el deber de informaci&oacute;n y documentaci&oacute;n sobre el derecho de desistimiento, el plazo para su ejercicio finalizar&aacute; doce meses despu&eacute;s de la fecha de expiraci&oacute;n del periodo de desistimiento inicial, a contar desde que se entreg&oacute; el bien contratado o se hubiera celebrado el contrato, si el objeto de &eacute;ste fuera la prestaci&oacute;n de servicios.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">Si el deber de informaci&oacute;n y documentaci&oacute;n se cumple durante el citado plazo de doce meses, el plazo legalmente previsto para el ejercicio del derecho de desistimiento empezar&aacute; a contar desde ese momento.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">4. Para determinar la observancia del plazo para desistir se tendr&aacute; en cuenta la fecha de expedici&oacute;n de la declaraci&oacute;n de desistimiento.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\"><br style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: none;\" />\r\n<strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: top; background: transparent;\">Art&iacute;culo 72. Prueba del ejercicio del derecho de desistimiento.</strong></p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">Corresponde al consumidor y usuario probar que ha ejercitado su derecho de desistimiento conforme a lo dispuesto en este cap&iacute;tulo.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\"><strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: top; background: transparent;\">Art&iacute;culo 73. Gastos vinculados al desistimiento.</strong></p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">El ejercicio del derecho de desistimiento no implicar&aacute; gasto alguno para el consumidor y usuario. A estos efectos se considerar&aacute; lugar de cumplimiento el lugar donde el consumidor y usuario haya recibido la prestaci&oacute;n.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\"><br style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: none;\" />\r\n<strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: top; background: transparent;\">Art&iacute;culo 74. Consecuencias del ejercicio del derecho de desistimiento.</strong></p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">1. Ejercido el derecho de desistimiento, las partes deber&aacute;n restituirse rec&iacute;procamente las prestaciones de acuerdo con lo dispuesto en los art&iacute;culos 1.303 y 1.308 del C&oacute;digo Civil.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">2. El consumidor y usuario no tendr&aacute; que rembolsar cantidad alguna por la disminuci&oacute;n del valor del bien, que sea consecuencia de su uso conforme a lo pactado o a su naturaleza, o por el uso del servicio.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">3. El consumidor y usuario tendr&aacute; derecho al rembolso de los gastos necesarios y &uacute;tiles que hubiera realizado en el bien.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">4. En caso de que el usuario incumpla el compromiso de permanencia adquirido con la empresa, la penalizaci&oacute;n por baja, o cese prematuro de la relaci&oacute;n contractual, ser&aacute; proporcional al n&uacute;mero de d&iacute;as no efectivos del compromiso de permanencia acordado.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\"><br style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: none;\" />\r\n<strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: top; background: transparent;\">Art&iacute;culo 75. Imposibilidad de devolver la prestaci&oacute;n por parte del consumidor y usuario.</strong></p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">1. La imposibilidad de devolver la prestaci&oacute;n objeto del contrato por parte del consumidor y usuario por p&eacute;rdida, destrucci&oacute;n u otra causa no privar&aacute;n a &eacute;ste de la posibilidad de ejercer el derecho de desistimiento.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">En estos casos, cuando la imposibilidad de devoluci&oacute;n le sea imputable, el consumidor y usuario responder&aacute; del valor de mercado que hubiera tenido la prestaci&oacute;n en el momento del ejercicio del derecho de desistimiento, salvo que dicho valor fuera superior al precio de adquisici&oacute;n, en cuyo caso responder&aacute; de &eacute;ste.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">2. Cuando el empresario hubiera incumplido el deber de informaci&oacute;n y documentaci&oacute;n sobre el derecho de desistimiento, la imposibilidad de devoluci&oacute;n s&oacute;lo ser&aacute; imputable al consumidor y usuario cuando &eacute;ste hubiera omitido la diligencia que le es exigible en sus propios asuntos.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\"><br style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: none;\" />\r\n<strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: top; background: transparent;\">Art&iacute;culo 76. Devoluci&oacute;n de sumas percibidas por el empresario.</strong></p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">Cuando el consumidor y usuario haya ejercido el derecho de desistimiento, el empresario estar&aacute; obligado a devolver las sumas abonadas por el consumidor y usuario sin retenci&oacute;n de gastos. La devoluci&oacute;n de estas sumas deber&aacute; efectuarse sin demoras indebidas y, en cualquier caso, antes de que hayan transcurrido 14 d&iacute;as naturales desde la fecha en que haya sido informado de la decisi&oacute;n de desistimiento del contrato por el consumidor y usuario.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">Transcurrido dicho plazo sin que el consumidor y usuario haya recuperado la suma adeudada, tendr&aacute; derecho a reclamarla duplicada, sin perjuicio de que adem&aacute;s se le indemnicen los da&ntilde;os y perjuicios que se le hayan causado en lo que excedan de dicha cantidad.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">Corresponde al empresario la carga de la prueba sobre el cumplimiento del plazo.</p>\r\n</div>','','','',0,1,1461826315,'',0,'http://',''),(39,2,'Formas de pago','<p>&nbsp;</p>\r\n<div class=\"theme_box secciontexto\" style=\"box-sizing: border-box; margin: 20px 0px 0px; padding: 20px 19px; border: 1px solid rgb(234, 234, 234); outline: 0px; vertical-align: top; position: relative; border-radius: 3px 3px 0px 0px; font-size: 13px; color: rgb(119, 119, 119); font-family: Arial, sans-serif; line-height: 20px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: padding-box; background-clip: padding-box; background-position: initial; background-repeat: initial;\">\r\n<h3 style=\"box-sizing: border-box; margin: 0px 0px 14px; padding: 0px; border: 0px; font-family: inherit; font-weight: inherit; line-height: 1em; color: inherit; font-size: 22px; outline: 0px; vertical-align: top; background: transparent;\">Contra-reembolso: pague en casa cuando lo reciba</h3>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">En esta modalidad no pagas nada hasta que recibas el pedido en tu casa, momento en el cual deber&aacute;s abonar el importe del pedido al repartidor.<br style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: none;\" />\r\nEl contra-reembolso conlleva un gasto adicional que puede variar seg&uacute;n el servicio de transporte que se escoja al realizar el pedido: desde 1 &euro; (impuestos no incluidos) los m&aacute;s baratos hasta el&nbsp; 0,9 % sobre el precio del art&iacute;culo en el caso de SEUR, debido a la comisi&oacute;n de la empresa de transporte.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">Si una vez enviado y confirmado el cliente no quisiera el pedido, deber&aacute; abonar en nuestra cuenta los gastos de env&iacute;o y retorno, que ascender&aacute;n a 15 &euro;.&nbsp;<br style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: none;\" />\r\nSeg&uacute;n la ley de comercio electr&oacute;nico 34/002, cualquier compra cursada y confirmada por internet debe ser aceptada despu&eacute;s de haber sido enviada.</p>\r\n<div class=\"alert alert-danger\" style=\"box-sizing: border-box; margin: 10px 0px 20px; padding: 15px; border: 1px solid rgb(235, 204, 209); font-weight: inherit; outline: 0px; vertical-align: top; border-radius: 4px; color: rgb(169, 68, 66); background: rgb(242, 222, 222);\">&nbsp;esta modalidad de pago para env&iacute;os a Toto</div>\r\n<div class=\"alert alert-info\" style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 15px; border: 1px solid rgb(188, 232, 241); font-weight: inherit; outline: 0px; vertical-align: top; border-radius: 4px; color: rgb(49, 112, 143); background: rgb(217, 237, 247);\">Esta modalidad de pago es la m&aacute;s r&aacute;pida, pues el pedido se prepara en nuestros almacenes en cuanto se recibe, y se env&iacute;a en cuanto est&aacute; preparado, tardando normalmente una media de 24 horas laborales.</div>\r\n</div>\r\n<div class=\"theme_box secciontexto\" style=\"box-sizing: border-box; margin: 0px; padding: 20px 19px; border-style: solid; border-width: 0px 1px 1px; border-color: rgb(234, 234, 234); outline: 0px; vertical-align: top; position: relative; border-radius: 0px; font-size: 13px; color: rgb(119, 119, 119); font-family: Arial, sans-serif; line-height: 20px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: padding-box; background-clip: padding-box; background-position: initial; background-repeat: initial;\">\r\n<h3 style=\"box-sizing: border-box; margin: 0px 0px 14px; padding: 0px; border: 0px; font-family: inherit; font-weight: inherit; line-height: 1em; color: inherit; font-size: 22px; outline: 0px; vertical-align: top; background: transparent;\">Transferencia o ingreso bancario</h3>\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">El pago mediante transferencia bancaria es un m&eacute;todo de pago sencillo para realizar compras a trav&eacute;s de Internet. Usted puede realizar dicho pago c&oacute;modamente desde su entidad bancaria.<br style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: none;\" />\r\nCuando escojas esta opci&oacute;n de pago y una vez finalizado tu pedido, tendr&aacute;s que esperar a la elaboraci&oacute;n de la factura pro forma que le enviaremos junto a todas las instrucciones para formalizar el pago.</p>\r\n<div class=\"alert alert-danger\" style=\"box-sizing: border-box; margin: 10px 0px 20px; padding: 15px; border: 1px solid rgb(235, 204, 209); font-weight: inherit; outline: 0px; vertical-align: top; border-radius: 4px; color: rgb(169, 68, 66); background: rgb(242, 222, 222);\">Recuerda que deber&aacute;s indicar como concepto del pago el n&uacute;mero de referencia de tu pedido para evitar errores en la gesti&oacute;n del mismo.</div>\r\n<div class=\"alert alert-info\" style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 15px; border: 1px solid rgb(188, 232, 241); font-weight: inherit; outline: 0px; vertical-align: top; border-radius: 4px; color: rgb(49, 112, 143); background: rgb(217, 237, 247);\">\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">Los pedidos cuyo pago no se haga efectivo en el plazo de 5 d&iacute;as, pierden la prioridad de stock y no garantizamos que el pedido pueda ser validado y enviado en el mismo d&iacute;a que se realice el pago.</p>\r\n</div>\r\n</div>\r\n<div class=\"theme_box secciontexto\" style=\"box-sizing: border-box; margin: 0px; padding: 20px 19px; border-style: solid; border-width: 0px 1px 1px; border-color: rgb(234, 234, 234); outline: 0px; vertical-align: top; position: relative; border-radius: 0px; font-size: 13px; color: rgb(119, 119, 119); font-family: Arial, sans-serif; line-height: 20px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: padding-box; background-clip: padding-box; background-position: initial; background-repeat: initial;\">\r\n<h3 style=\"box-sizing: border-box; margin: 0px 0px 14px; padding: 0px; border: 0px; font-family: inherit; font-weight: inherit; line-height: 1em; color: inherit; font-size: 22px; outline: 0px; vertical-align: top; background: transparent;\">Tarjeta de cr&eacute;dito/d&eacute;bito</h3>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">Mediante esta modalidad de pago GsmLanTe nunca recoge ni manipula ning&uacute;n dato del cliente relativo a su n&uacute;mero de tarjeta. Todos los datos son tratados directamente por la pasarela de pago seguro de La Caixa, de forma que &nbsp;GsmLanTe&nbsp;siempre pueda ofrecer la mayor seguridad, transparencia y confidencialidad en la transacci&oacute;n. El pago de los pedidos se realiza directamente con la entidad bancaria, ofreci&eacute;ndote de este modo la m&aacute;xima seguridad.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">En&nbsp;GsmLanTe&nbsp;siempre revisamos los pedidos realizados antes de efectuar el cobro, para asegurarnos de que todo el material pedido est&aacute; disponible en el momento de realizar el pago. Por ello el pedido no se paga en el momento de finalizarlo, si no que la forma de pago con tarjeta funciona de la siguiente manera:</p>\r\n<ol style=\"box-sizing: border-box; margin: 0px; padding: 10px 0px 0px 40px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; list-style: none; counter-reset: numList 0; background: transparent;\">\r\n    <li style=\"box-sizing: border-box; margin: 5px 0px 10px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; position: relative; line-height: 1.3; background: transparent;\">En el proceso de compra selecciona &quot;Pago con tarjeta&quot;.</li>\r\n    <li style=\"box-sizing: border-box; margin: 5px 0px 10px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; position: relative; line-height: 1.3; background: transparent;\">El pedido llegar&aacute; a nuestro departamento de ventas, donde se revisar&aacute; y comprobar&aacute; que todo el material est&aacute; disponible.</li>\r\n    <li style=\"box-sizing: border-box; margin: 5px 0px 10px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; position: relative; line-height: 1.3; background: transparent;\">Una vez comprobado, generaremos un enlace personal para ti, que te ser&aacute; enviado a tu correo electr&oacute;nico.</li>\r\n    <li style=\"box-sizing: border-box; margin: 5px 0px 10px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; position: relative; line-height: 1.3; background: transparent;\">Cuando recibas el mensaje de correo electr&oacute;nico, no tiense m&aacute;s que hacer click en el enlace proporcionado y se abrir&aacute; la pasarela de pago seguro para que introduzcas los datos de su tarjeta.</li>\r\n    <li style=\"box-sizing: border-box; margin: 5px 0px 10px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; position: relative; line-height: 1.3; background: transparent;\">Al finalizar el pago, empaquetaremos y enviaremos tu pedido.</li>\r\n</ol>\r\n<div class=\"alert alert-info\" style=\"box-sizing: border-box; margin: 20px 0px; padding: 15px; border: 1px solid rgb(188, 232, 241); font-weight: inherit; outline: 0px; vertical-align: top; border-radius: 4px; color: rgb(49, 112, 143); background: rgb(217, 237, 247);\">\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">Los pedidos cuyo pago no se haga efectivo en el plazo de 5 d&iacute;as, pierden la prioridad de stock y no garantizamos que el pedido pueda ser validado y enviado en el mismo d&iacute;a que se realice el pago.</p>\r\n</div>\r\n</div>\r\n<div class=\"theme_box secciontexto\" style=\"box-sizing: border-box; margin: 0px; padding: 20px 19px; border-style: solid; border-width: 0px 1px 1px; border-color: rgb(234, 234, 234); outline: 0px; vertical-align: top; position: relative; border-radius: 0px 0px 3px 3px; font-size: 13px; color: rgb(119, 119, 119); font-family: Arial, sans-serif; line-height: 20px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: padding-box; background-clip: padding-box; background-position: initial; background-repeat: initial;\">\r\n<h3 style=\"box-sizing: border-box; margin: 0px 0px 14px; padding: 0px; border: 0px; font-family: inherit; font-weight: inherit; line-height: 1em; color: inherit; font-size: 22px; outline: 0px; vertical-align: top; background: transparent;\">PayPal</h3>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">Mediante esta modalidad de pago&nbsp;GsmLanTe&nbsp;nunca recoge ni manipula ning&uacute;n dato del cliente relativo a su n&uacute;mero de cuenta o tarjeta, y toda la transacci&oacute;n se hace mediante el sistema seguro de PayPal.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">Esta modalidad de pago conlleva un coste adicional 3,4% del total + 0,35&euro; por operaci&oacute;n (impuestos no incluidos), en concepto de comisi&oacute;n que carga PayPal sobre las compras efectuadas a trav&eacute;s de su pasarela de pago.<br style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: none;\" />\r\n<br style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: none;\" />\r\nEn&nbsp;GsmLanTe&nbsp;siempre revisamos los pedidos realizados antes de efectuar el cobro, para asegurarnos de que todo el material pedido est&aacute; disponible en el momento de realizar el pago. Por ello el pedido no se paga en el momento de finalizarlo, si no que la forma de pago con tarjeta funciona de la siguiente manera:</p>\r\n<ol style=\"box-sizing: border-box; margin: 0px; padding: 10px 0px 0px 40px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; list-style: none; counter-reset: numList 0; background: transparent;\">\r\n    <li style=\"box-sizing: border-box; margin: 5px 0px 10px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; position: relative; line-height: 1.3; background: transparent;\">En el proceso de compra selecciona &quot;Pago con PayPal&quot;.</li>\r\n    <li style=\"box-sizing: border-box; margin: 5px 0px 10px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; position: relative; line-height: 1.3; background: transparent;\">El pedido llegar&aacute; a nuestro departamento de ventas, donde se revisar&aacute; y comprobar&aacute; que todo el material est&aacute; disponible.</li>\r\n    <li style=\"box-sizing: border-box; margin: 5px 0px 10px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; position: relative; line-height: 1.3; background: transparent;\">Una vez comprobado, generaremos un enlace personal para ti, que te ser&aacute; enviado a tu correo electr&oacute;nico.</li>\r\n    <li style=\"box-sizing: border-box; margin: 5px 0px 10px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; position: relative; line-height: 1.3; background: transparent;\">Cuando recibas el mensaje de correo electr&oacute;nico, no tienee m&aacute;s que hacer click en el enlace proporcionado y se abrir&aacute; la pasarela de pago seguro de PayPal para que hagas efectivo el pago.</li>\r\n    <li style=\"box-sizing: border-box; margin: 5px 0px 10px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; position: relative; line-height: 1.3; background: transparent;\">Al finalizar el pago, empaquetaremos y enviaremos tu pedido.</li>\r\n</ol>\r\n<div class=\"alert alert-info\" style=\"box-sizing: border-box; margin: 20px 0px; padding: 15px; border: 1px solid rgb(188, 232, 241); font-weight: inherit; outline: 0px; vertical-align: top; border-radius: 4px; color: rgb(49, 112, 143); background: rgb(217, 237, 247);\">\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">Los pedidos cuyo pago no se haga efectivo en el plazo de 5 d&iacute;as, pierden la prioridad de stock y no garantizamos que el pedido pueda ser validado y enviado en el mismo d&iacute;a que se realice el pago.</p>\r\n</div>\r\n</div>','','','',0,1,1461826729,'',0,'http://',''),(40,2,'Transporte','<p>&nbsp;</p>\r\n<h1 style=\"box-sizing: border-box; margin: 0px 0px 14px; padding: 0px; border: 0px; font-size: 30px; font-family: Arial, sans-serif; font-weight: inherit; line-height: 1em; color: rgb(119, 119, 119); outline: 0px; vertical-align: top; background: rgb(252, 252, 252);\">Transporte</h1>\r\n<hr style=\"box-sizing: content-box; margin: 0px; padding: 0px; border-top-style: solid; border-right-width: 0px; border-bottom-width: 0px; border-left-width: 0px; border-color: rgb(234, 234, 234); height: 0px; color: rgb(119, 119, 119); font-family: Arial, sans-serif; font-size: 13px; line-height: 20px; background-color: rgb(252, 252, 252);\" />\r\n<div class=\"alert alert-success\" style=\"box-sizing: border-box; margin: 20px 0px; padding: 15px; border: 1px solid rgb(214, 233, 198); outline: 0px; vertical-align: top; border-radius: 4px; color: rgb(60, 118, 61); font-family: Arial, sans-serif; font-size: 13px; line-height: 20px; background: rgb(223, 240, 216);\">\r\n<h4 style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-family: inherit; font-weight: inherit; line-height: 1em; color: inherit; font-size: 18px; outline: 0px; vertical-align: top; background: transparent;\">Env&iacute;o gratuito para compras superiores a 200 &euro; (*)&nbsp;<span style=\"box-sizing: border-box; margin: 0px 0px 0px 5px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; font-size: 11px; line-height: 22px; background: transparent;\">* Oferta v&aacute;lida para envios a Espa&ntilde;a Peninsular. Excluido PayPal como forma de pago.</span></h4>\r\n</div>\r\n<div class=\"theme_box secciontexto\" style=\"box-sizing: border-box; margin: 0px; padding: 20px 19px; border: 1px solid rgb(234, 234, 234); outline: 0px; vertical-align: top; position: relative; border-radius: 3px 3px 0px 0px; font-size: 13px; color: rgb(119, 119, 119); font-family: Arial, sans-serif; line-height: 20px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: padding-box; background-clip: padding-box; background-position: initial; background-repeat: initial;\">\r\n<h3 style=\"box-sizing: border-box; margin: 0px 0px 14px; padding: 0px; border: 0px; font-family: inherit; font-weight: inherit; line-height: 1em; color: inherit; font-size: 22px; outline: 0px; vertical-align: top; background: transparent;\">Servicios/Empresas de transporte</h3>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">GSMLANTE S.L. env&iacute;a todos sus pedidos a trav&eacute;s de varias empresas de transporte, para que nuestros clientes puedan escoger el servicio que prefieran.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">La agencia de transportes llevar&aacute; los productos a tu domicilio. En caso de no haber nadie en tu domicilio para recoger el pedido, el mensajero te dejar&aacute; una nota siempre y cuando el mensajero tenga acceso a un buz&oacute;n. Si hubiera alg&uacute;n problema con el transporte, puedes contactar con nosotros por email en&nbsp;<a href=\"javascript:location.href=\'mailto:\'+String.fromCharCode(108,97,110,116,101,103,115,109,64,104,111,116,109,97,105,108,46,99,111,109)+\'?\'\">lantegsm@hotmail.com</a>&nbsp;e intentaremos resolverlo en la mayor brevedad.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">En GsmLanTe hacemos env&iacute;os a pr&aacute;cticamente todos los pa&iacute;ses del mundo.</p>\r\n</div>\r\n<div class=\"theme_box secciontexto\" style=\"box-sizing: border-box; margin: 0px; padding: 20px 19px; border-style: solid; border-width: 0px 1px 1px; border-color: rgb(234, 234, 234); outline: 0px; vertical-align: top; position: relative; border-radius: 0px; font-size: 13px; color: rgb(119, 119, 119); font-family: Arial, sans-serif; line-height: 20px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: padding-box; background-clip: padding-box; background-position: initial; background-repeat: initial;\">\r\n<h3 style=\"box-sizing: border-box; margin: 0px 0px 14px; padding: 0px; border: 0px; font-family: inherit; font-weight: inherit; line-height: 1em; color: inherit; font-size: 22px; outline: 0px; vertical-align: top; background: transparent;\">Plazos de entrega</h3>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">El plazo de entrega, salvo alguna incidencia, est&aacute; estipulado entre 24-48 horas laborales en la Pen&iacute;nsula y 48-72 horas a Baleares, a partir de la salida del paquete de nuestras instalaciones. No nos hacemos responsables de posibles retrasos por parte del transportista.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">Una vez hayamos recibido el pago de tu compra por tarjeta o por transferencia, o en cuanto hayas realizado una compra por contra-reembolso, prepararemos tu pedido que saldr&aacute; como m&aacute;s tardar a las ocho de la tarde de ese mismo d&iacute;a (si el pedido se realiza antes de las siete, en caso contrario se enviar&aacute; al d&iacute;a siguiente).</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">Seg&uacute;n la hora del d&iacute;a, daremos m&aacute;s o menos servicios a escoger. Esto se hace porque los transportistas de cada empresa recogen los pedidos de nuestros almacenes en distintos horarios, y para evitar que el env&iacute;o a un cliente se retrase 24 horas adicionales, a determinadas horas solo ofrecemos el servicio de las empresas que puedan garantizar la entrega en los plazos arriba indicados.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">Tambi&eacute;n disponemos de env&iacute;os urgentes, para recibir a las 10:00 del d&iacute;a siguiente, a las 14:00, y para recibir en s&aacute;bados. Estos servicios est&aacute;n sujetos a determinadas localizaciones, por lo que no te aparecer&aacute;n como opci&oacute;n de transporte si tu zona no se encuentra entre las incluidas.</p>\r\n</div>\r\n<div class=\"theme_box secciontexto\" style=\"box-sizing: border-box; margin: 0px; padding: 20px 19px; border-style: solid; border-width: 0px 1px 1px; border-color: rgb(234, 234, 234); outline: 0px; vertical-align: top; position: relative; border-radius: 0px 0px 3px 3px; font-size: 13px; color: rgb(119, 119, 119); font-family: Arial, sans-serif; line-height: 20px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: padding-box; background-clip: padding-box; background-position: initial; background-repeat: initial;\">\r\n<h3 style=\"box-sizing: border-box; margin: 0px 0px 14px; padding: 0px; border: 0px; font-family: inherit; font-weight: inherit; line-height: 1em; color: inherit; font-size: 22px; outline: 0px; vertical-align: top; background: transparent;\">Precios seg&uacute;n zonas</h3>\r\n<ul class=\"check\" style=\"box-sizing: border-box; margin: 0px 0px 0px 20px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; list-style: none; background: transparent;\">\r\n    <li style=\"box-sizing: border-box; margin: 5px 0px 10px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\"><b style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: top; background: transparent;\">Espa&ntilde;a peninsular:</b>&nbsp;desde 4,80 &euro;</li>\r\n    <li style=\"box-sizing: border-box; margin: 5px 0px 10px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">&nbsp;<b style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: top; background: transparent;\">Baleares:</b>&nbsp;desde 7,25 &euro;</li>\r\n    <li style=\"box-sizing: border-box; margin: 5px 0px 10px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">&nbsp;<b style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: top; background: transparent;\">Canarias:</b>&nbsp;desde 19 &euro;</li>\r\n    <li style=\"box-sizing: border-box; margin: 5px 0px 10px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">&nbsp;<b style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: top; background: transparent;\">Ceuta y Melilla</b>: desde 24 &euro;</li>\r\n    <li style=\"box-sizing: border-box; margin: 5px 0px 10px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">&nbsp;<b style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: top; background: transparent;\">Portugal:</b>&nbsp;desde 4,80 &euro;</li>\r\n    <li style=\"box-sizing: border-box; margin: 5px 0px 10px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">&nbsp;<b style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: top; background: transparent;\">Alemania, Austria, B&eacute;lgica, Vaticano, Dinamarca, Francia, Paises Bajos, Italia, Francia, Irlanda, Luxemburgo, M&oacute;naco, Polonia, Reino Unido, San Marino, Suiza:</b>&nbsp;13 &euro;</li>\r\n    <li style=\"box-sizing: border-box; margin: 5px 0px 10px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">&nbsp;<b style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: top; background: transparent;\">Resto del mundo:</b>&nbsp;variable seg&uacute;n pa&iacute;s, desde 13 &euro;</li>\r\n</ul>\r\n<div class=\"alert alert-danger\" style=\"box-sizing: border-box; margin: 20px 0px; padding: 15px; border: 1px solid rgb(235, 204, 209); font-weight: inherit; outline: 0px; vertical-align: top; border-radius: 4px; color: rgb(169, 68, 66); background: rgb(242, 222, 222);\">Los pedidos enviados contra-reembolso tienen una comisi&oacute;n extra que se calcular&aacute; en el momento de hacer el pedido. La comisi&oacute;n de reembolso tiene un valor de 1 &euro;, a excepci&oacute;n de Seur, donde podr&aacute; incrementarse algo m&aacute;s en funci&oacute;n del coste del env&iacute;o.</div>\r\n</div>','','','',0,1,1461826930,'',0,'http://',''),(41,2,'Quiénes somos','<p>&nbsp;</p>\r\n<div class=\"theme_box secciontexto\" style=\"box-sizing: border-box; margin: 20px 0px 0px; padding: 20px 19px; border: 1px solid rgb(234, 234, 234); outline: 0px; vertical-align: top; position: relative; border-radius: 3px 3px 0px 0px; font-size: 13px; color: rgb(119, 119, 119); font-family: Arial, sans-serif; line-height: 20px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: padding-box; background-clip: padding-box; background-position: initial; background-repeat: initial;\">\r\n<h3 style=\"box-sizing: border-box; margin: 0px 0px 14px; padding: 0px; border: 0px; font-family: inherit; font-weight: inherit; line-height: 1em; color: inherit; font-size: 22px; outline: 0px; vertical-align: top; background: transparent;\">GSMLANTE S.L.</h3>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; outline: 0px; vertical-align: top; background: transparent;\"><b>GsmLanTe</b><span style=\"font-weight: inherit;\">&nbsp;es la tienda on line n&uacute;mero UNO en Espa&ntilde;a en el campo de los repuestos de telefon&iacute;a m&oacute;vil.</span></p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">Desde su llegada a la red en el a&ntilde;o 2000, ha sido un referente para todos los t&eacute;cnicos y particulares que est&aacute;n dispuestos a reparar, desde tel&eacute;fonos m&oacute;viles, tablets, llaves de autom&oacute;vil o toda la electr&oacute;nica en general.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">Nuestro &eacute;xito se basa en proveer a nuestros clientes de los repuestos de calidad que necesitan sin importar su ubicaci&oacute;n geogr&aacute;fica, a los mejores precios y en un plazo de tiempo r&eacute;cord que siempre sorprende.</p>\r\n</div>\r\n<div class=\"theme_box secciontexto\" style=\"box-sizing: border-box; margin: 0px; padding: 20px 19px; border-style: solid; border-width: 0px 1px 1px; border-color: rgb(234, 234, 234); outline: 0px; vertical-align: top; position: relative; border-radius: 0px; font-size: 13px; color: rgb(119, 119, 119); font-family: Arial, sans-serif; line-height: 20px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: padding-box; background-clip: padding-box; background-position: initial; background-repeat: initial;\">\r\n<h3 style=\"box-sizing: border-box; margin: 0px 0px 14px; padding: 0px; border: 0px; font-family: inherit; font-weight: inherit; line-height: 1em; color: inherit; font-size: 22px; outline: 0px; vertical-align: top; background: transparent;\">Tienda on-line</h3>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">En GsmLanTe contamos con una tienda on line con m&aacute;s de 15.000 art&iacute;culos que van desde recambios de telefon&iacute;a m&oacute;vil, tales como pantallas, carcasas, fundas, altavoces, de las principales marcas (Samsung, Apple, etc.), hasta la electr&oacute;nica m&aacute;s generalizada.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">Tambi&eacute;n somos especialistas en la venta de herramientas b&aacute;sicas y avanzadas para reparaci&oacute;n electr&oacute;nica, y clonado de mandos para veh&iacute;culo,</p>\r\n</div>\r\n<div class=\"theme_box secciontexto\" style=\"box-sizing: border-box; margin: 0px; padding: 20px 19px; border-style: solid; border-width: 0px 1px 1px; border-color: rgb(234, 234, 234); outline: 0px; vertical-align: top; position: relative; border-radius: 0px 0px 3px 3px; font-size: 13px; color: rgb(119, 119, 119); font-family: Arial, sans-serif; line-height: 20px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: padding-box; background-clip: padding-box; background-position: initial; background-repeat: initial;\">\r\n<h3 style=\"box-sizing: border-box; margin: 0px 0px 14px; padding: 0px; border: 0px; font-family: inherit; font-weight: inherit; line-height: 1em; color: inherit; font-size: 22px; outline: 0px; vertical-align: top; background: transparent;\">Servicio t&eacute;cnico</h3>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">Nuestro SAT, situado en Vigo, lleva m&aacute;s de 15 a&ntilde;os siendo un referente en la ciudad para todas aquellas personas que quieren liberar o reparar su m&oacute;vil, tanto para aver&iacute;as f&iacute;sicas como de software, contando para ello con t&eacute;cnicos altamente cualificados y con mucha experiencia.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">Con la tendencia de los &uacute;ltimos a&ntilde;os, donde los smartphones forman parte de nuestra vida cotidiana, nos hemos convertido en especialistas en la reparaci&oacute;n de terminales de Apple, como los &uacute;ltimos iPhone, as&iacute; como Samsung Galaxy, LG, Sony, y pr&aacute;cticamente todas las marcas del mercado, llevando a cabo desde las reparaciones m&aacute;s simples, como cambios de pantallas y carcasas, hasta las m&aacute;s complicadas, como aver&iacute;as de placa, humedad, etc.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">Si necesitas reparar o liberar tu m&oacute;vil, no dudes en ponerte en contacto con nosotros.</p>\r\n</div>','','','',0,1,1461827262,'',0,'http://',''),(42,2,'Dónde estamos','<p>&nbsp;D&oacute;nde estamos</p>\r\n<p><iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3044.3440126194064!2d-3.7479718850801396!3d40.268107779382674!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0xd418aa03218b4eb%3A0x7de9a9738784bc2d!2sCalle+Bembibre%2C+1%2C+28947+Fuenlabrada%2C+Madrid!5e0!3m2!1szh-CN!2ses!4v1461962553820\" width=\"600\" height=\"450\" frameborder=\"0\" style=\"border:0\" allowfullscreen=\"\"></iframe></p>','','','',0,1,1461827435,'',0,'http://',''),(43,2,'Contacta con nosotros','','','','',0,1,1461827472,'',0,'http://www.fssay.com/message.php',''),(44,2,'Política de cookies','<div class=\"theme_box\" style=\"box-sizing: border-box; margin: 0px; padding: 20px 19px; border: 1px solid rgb(234, 234, 234); outline: 0px; vertical-align: top; position: relative; border-radius: 3px 3px 0px 0px; color: rgb(119, 119, 119); font-family: Arial, sans-serif; font-size: 13px; line-height: 20px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: padding-box; background-clip: padding-box; background-position: initial; background-repeat: initial;\">\r\n<h3 style=\"box-sizing: border-box; margin: 0px 0px 14px; padding: 0px; border: 0px; font-family: inherit; font-weight: inherit; line-height: 1em; color: inherit; font-size: 22px; outline: 0px; vertical-align: top; background: transparent;\">&nbsp; C&oacute;mo utiliza GsmLanTe las cookies</h3>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">Una cookie es un peque&ntilde;o fragmento de texto que los sitios web que visitas  \tenv&iacute;an al navegador y que permite que el sitio web recuerde informaci&oacute;n  \tsobre tu visita, como tu idioma preferido y otras opciones, lo que puede  \tfacilitar tu pr&oacute;xima visita y hacer que el sitio te resulte m&aacute;s &uacute;til. Las  \tcookies desempe&ntilde;an un papel muy importante, ya que sin ellas el uso de la  \tWeb ser&iacute;a una experiencia mucho m&aacute;s frustrante.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-weight: inherit; outline: 0px; vertical-align: top; background: transparent;\">GsmLanTe utiliza cookies con diversos fines, entre los que se incluyen  \trecordar tus preferencias de SafeSearch, aumentar la relevancia de los  \tanuncios que ves, contar el n&uacute;mero de visitas que recibimos para acceder a  \tuna p&aacute;gina, ayudarte a registrarte en nuestros servicios y proteger tus  \tdatos.</p>\r\n</div>\r\n<p style=\"box-sizing: border-box; font-weight: inherit; outline: 0px; vertical-align: top; border-style: none; border-color: inherit; border-width: 0px; margin: 0px; padding: 0px; background: url(\'\')\">&nbsp;</p>\r\n<p style=\"box-sizing: border-box; font-weight: inherit; outline: 0px; vertical-align: top; border-style: none; border-color: inherit; border-width: 0px; margin: 0px; padding: 0px; background: url(\'\')\">&nbsp;</p>\r\n<p style=\"box-sizing: border-box; font-weight: inherit; outline: 0px; vertical-align: top; border-style: none; border-color: inherit; border-width: 0px; margin: 0px; padding: 0px; background: url(\'\')\">Tipos de cookies:</p>\r\n<p style=\"box-sizing: border-box; font-weight: inherit; outline: 0px; vertical-align: top; border-style: none; border-color: inherit; border-width: 0px; margin: 0px; padding: 0px; background: url(\'\')\">&nbsp;</p>\r\n<table style=\"width: 100%\">\r\n    <tbody>\r\n        <tr>\r\n            <td style=\"width: 282px\">Categor&iacute;a&nbsp;de&nbsp;uso</td>\r\n            <td class=\"style1\">Ejemplo</td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<table style=\"width: 100%\">\r\n    <tbody>\r\n        <tr>\r\n            <td style=\"width: 280px\">Esenciales</td>\r\n            <td><span style=\"color: rgb(119, 119, 119); font-family: Arial, sans-serif; font-size: 13px; line-height: 18.5714px;\"> \t\tExisten cookies imprescindibles para el funcionamiento de nuestra web.  \t\tSin estas, el usuario no podria desplazarse a trav&eacute;s de la web y usar  \t\talgunas de las opciones y funcionalidades. Gracias a las cookies  \t\tesenciales, la informaci&oacute;n que suministra el usuario y las decisiones  \t\tque toma de navegaci&oacute;n pueden recordarse al pasar de una p&aacute;gina durante  \t\tla cumplimentaci&oacute;n de formularios.</span></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<table style=\"width: 100%\">\r\n    <tbody>\r\n        <tr>\r\n            <td style=\"width: 280px\">Preferencias</td>\r\n            <td>\r\n            <p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; outline: 0px; vertical-align: top; color: rgb(119, 119, 119); font-family: Arial, sans-serif; font-size: 13px; line-height: 18.5714px; background: transparent;\">Estas cookies permiten que nuestro sitios web recuerden informaci&oacute;n que  \t\tcambia el aspecto o el comportamiento del sitio como, por ejemplo, tu  \t\tidioma preferido o la regi&oacute;n en la que te encuentras.</p>\r\n            <p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: top; color: rgb(119, 119, 119); font-family: Arial, sans-serif; font-size: 13px; line-height: 18.5714px; background: transparent;\">La p&eacute;rdida de la informaci&oacute;n almacenada en una cookie de preferencias  \t\tpuede hacer que la experiencia del sitio web sea menos funcional, pero  \t\tno debe afectar a su funcionamiento.</p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<table style=\"width: 100%\">\r\n    <tbody>\r\n        <tr>\r\n            <td style=\"width: 280px\"><span style=\"color: rgb(119, 119, 119); font-family: Arial, sans-serif; font-size: 13px; line-height: 18.5714px;\"> \t\tSeguridad</span></td>\r\n            <td><span style=\"color: rgb(119, 119, 119); font-family: Arial, sans-serif; font-size: 13px; line-height: 18.5714px;\"> \t\tUtilizamos cookies cifradas de seguridad para autenticar a usuarios,  \t\tevitar el uso fraudulento de credenciales de inicio de sesi&oacute;n y proteger  \t\tlos datos de usuarios frente a terceros no autorizados.</span></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<table style=\"width: 100%\">\r\n    <tbody>\r\n        <tr>\r\n            <td style=\"width: 280px\"><span style=\"color: rgb(119, 119, 119); font-family: Arial, sans-serif; font-size: 13px; line-height: 18.5714px;\"> \t\tProcesos</span></td>\r\n            <td><span style=\"color: rgb(119, 119, 119); font-family: Arial, sans-serif; font-size: 13px; line-height: 18.5714px;\"> \t\tLas cookies de procesos permiten el funcionamiento del sitio web y  \t\tofrecen servicios esperados por el usuario que accede al sitio web como,  \t\tpor ejemplo, la navegaci&oacute;n por p&aacute;ginas web o el acceso a &aacute;reas privadas  \t\tdel sitio web. Sin estas cookies, el sitio web no puede funcionar de  \t\tforma adecuada.</span></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<table style=\"width: 100%\">\r\n    <tbody>\r\n        <tr>\r\n            <td style=\"width: 280px\"><span style=\"color: rgb(119, 119, 119); font-family: Arial, sans-serif; font-size: 13px; line-height: 18.5714px;\"> \t\tEstado de la sesi&oacute;n</span></td>\r\n            <td><span style=\"color: rgb(119, 119, 119); font-family: Arial, sans-serif; font-size: 13px; line-height: 18.5714px;\"> \t\tLos sitios web suelen recopilar informaci&oacute;n sobre la forma en la que los  \t\tusuarios interact&uacute;an con un sitio web. Esta informaci&oacute;n puede incluir  \t\tlas p&aacute;ginas que los usuarios visitan con mayor frecuencia y si los  \t\tusuarios reciben mensajes de error de determinadas p&aacute;ginas. Utilizamos  \t\tlas denominadas &quot;cookies de estado de la sesi&oacute;n&quot; para poder mejorar  \t\tnuestros servicios con el fin de mejorar la experiencia de navegaci&oacute;n de  \t\tlos usuarios.</span></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<table style=\"width: 100%\">\r\n    <tbody>\r\n        <tr>\r\n            <td style=\"width: 280px\"><span style=\"color: rgb(119, 119, 119); font-family: Arial, sans-serif; font-size: 13px; line-height: 18.5714px;\"> \t\tGoogle Analytics</span></td>\r\n            <td><span style=\"color: rgb(119, 119, 119); font-family: Arial, sans-serif; font-size: 13px; line-height: 18.5714px;\"> \t\tGoogle Analytics es una herramienta gratuita de an&aacute;lisis web de Google  \t\tque principalmente permite que los propietarios de sitios web conozcan  \t\tc&oacute;mo interact&uacute;an los usuarios con su sitio web. Asimismo, habilita  \t\tcookies en el dominio del sitio en el que te encuentras y utiliza un  \t\tconjunto de cookies denominadas &quot;__utma&quot; y &quot;__utmz&quot; para recopilar  \t\tinformaci&oacute;n de forma an&oacute;nima y elaborar informes de tendencias de sitios  \t\tweb sin identificar a usuarios individuales.</span></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<table style=\"width: 100%\">\r\n    <tbody>\r\n        <tr>\r\n            <td style=\"width: 280px\">&nbsp;</td>\r\n            <td>&nbsp;</td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<table style=\"width: 100%\">\r\n    <tbody>\r\n        <tr>\r\n            <td style=\"width: 280px\">&nbsp;</td>\r\n            <td>&nbsp;</td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<table style=\"width: 100%\">\r\n    <tbody>\r\n        <tr>\r\n            <td style=\"width: 280px\">&nbsp;</td>\r\n            <td>&nbsp;</td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<table style=\"width: 100%\">\r\n    <tbody>\r\n        <tr>\r\n            <td><span style=\"color: rgb(119, 119, 119); font-family: Arial, sans-serif; font-size: 13px; line-height: 20px;\"> \t\tAdjuntamos algunos enlaces donde puede consultar/configurar las opciones  \t\tde privacidad:</span></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<table style=\"width: 100%\">\r\n    <tbody>\r\n        <tr>\r\n            <td>&nbsp;</td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<table style=\"width: 100%\">\r\n    <tbody>\r\n        <tr>\r\n            <td>Chrome:&nbsp;<a href=\"http://C&oacute;mo utiliza GsmLanTe las cookies Una cookie es un peque&ntilde;o fragmento de texto que los sitios web que visitas env&iacute;an al navegador y que permite que el sitio web recuerde informaci&oacute;n sobre tu visita, como tu idioma preferido y otras opciones, lo que puede facilitar tu pr&oacute;xima visita y hacer que el sitio te resulte m&aacute;s &uacute;til. Las cookies desempe&ntilde;an un papel muy importante, ya que sin ellas el uso de la Web ser&iacute;a una experiencia mucho m&aacute;s frustrante. GsmLanTe utiliza cookies con diversos fines, entre los que se incluyen recordar tus preferencias de SafeSearch, aumentar la relevancia de los anuncios que ves, contar el n&uacute;mero de visitas que recibimos para acceder a una p&aacute;gina, ayudarte a registrarte en nuestros servicios y proteger tus datos. &nbsp; &nbsp; Tipos de cookies: &nbsp; Categor&iacute;a&nbsp;de&nbsp;usoEjemploEsencialesExisten cookies imprescindibles para el funcionamiento de nuestra web. Sin estas, el usuario no podria desplazarse a trav&eacute;s de la web y usar algunas de las opciones y funcionalidades. Gracias a las cookies esenciales, la informaci&oacute;n que suministra el usuario y las decisiones que toma de navegaci&oacute;n pueden recordarse al pasar de una p&aacute;gina durante la cumplimentaci&oacute;n de formularios.PreferenciasEstas cookies permiten que nuestro sitios web recuerden informaci&oacute;n que cambia el aspecto o el comportamiento del sitio como, por ejemplo, tu idioma preferido o la regi&oacute;n en la que te encuentras. La p&eacute;rdida de la informaci&oacute;n almacenada en una cookie de preferencias puede hacer que la experiencia del sitio web sea menos funcional, pero no debe afectar a su funcionamiento. SeguridadUtilizamos cookies cifradas de seguridad para autenticar a usuarios, evitar el uso fraudulento de credenciales de inicio de sesi&oacute;n y proteger los datos de usuarios frente a terceros no autorizados.ProcesosLas cookies de procesos permiten el funcionamiento del sitio web y ofrecen servicios esperados por el usuario que accede al sitio web como, por ejemplo, la navegaci&oacute;n por p&aacute;ginas web o el acceso a &aacute;reas privadas del sitio web. Sin estas cookies, el sitio web no puede funcionar de forma adecuada.Estado de la sesi&oacute;nLos sitios web suelen recopilar informaci&oacute;n sobre la forma en la que los usuarios interact&uacute;an con un sitio web. Esta informaci&oacute;n puede incluir las p&aacute;ginas que los usuarios visitan con mayor frecuencia y si los usuarios reciben mensajes de error de determinadas p&aacute;ginas. Utilizamos las denominadas &quot;cookies de estado de la sesi&oacute;n&quot; para poder mejorar nuestros servicios con el fin de mejorar la experiencia de navegaci&oacute;n de los usuarios.Google AnalyticsGoogle Analytics es una herramienta gratuita de an&aacute;lisis web de Google que principalmente permite que los propietarios de sitios web conozcan c&oacute;mo interact&uacute;an los usuarios con su sitio web. Asimismo, habilita cookies en el dominio del sitio en el que te encuentras y utiliza un conjunto de cookies denominadas &quot;__utma&quot; y &quot;__utmz&quot; para recopilar informaci&oacute;n de forma an&oacute;nima y elaborar informes de tendencias de sitios web sin identificar a usuarios individuales.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Adjuntamos algunos enlaces donde puede consultar/configurar las opciones de privacidad:&nbsp;Chrome:&nbsp;http://support.google.com/chrome/bin/answer.py?hl=es&amp;answer=95647Firefox:&nbsp;http://support.mozilla.org/es/products/firefox/cookiesInternet Explorer:&nbsp;http://windows.microsoft.com/es-es/windows7/how-to-manage-cookies-in-internet-explorer-9Safari:&nbsp;http://support.apple.com/kb/ph5042\">http://support.google.com/chrome/bin/answer.py?hl=es&amp;answer=95647</a></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<table style=\"width: 100%\">\r\n    <tbody>\r\n        <tr>\r\n            <td><span style=\"color: rgb(119, 119, 119); font-family: Arial, sans-serif; font-size: 13px; line-height: 20px;\"> \t\tFirefox:&nbsp;</span><a target=\"_blank\" style=\"box-sizing: 